function renounceOwnership() public {
    // Ensure that only the current owner can call this function
    require(msg.sender == _owner, "Ownable: caller is not the Owner");

    /*
        The original bytecode truncates the stored owner address to its
        lower-96 bits before emitting the event.  
        Although this is unusual, we reproduce the exact behaviour here
        to stay faithful to the on-chain logic.
    */
    _owner = address(uint160(uint96(uint160(_owner))));

    // Emit the OwnershipTransferred event with the (now-truncated) owner
    emit OwnershipTransferred(_owner, address(0));
}
